function showTopic(number) {

	// show legend header
	document.getElementById("legend_heading1").firstChild.nodeValue = myTopics[number][13];
	document.getElementById("legend_heading2").firstChild.nodeValue = myTopics[number][14];

	// highlight the active topic
	for (var i = 1; i <6; i++) {
		if (i == number) { 
			document.getElementById('bullet_'+myTopics[i][0]).setAttribute('class','show');
		} else {
			document.getElementById('bullet_'+myTopics[i][0]).setAttribute('class','hide');
		}
	}

	// show maximum class values and set fill color
	for (var i = 1; i <5; i++) {
		document.getElementById("boxclass"+[i]).setAttribute('fill',myTopics[number][i+4]);
		document.getElementById("classmax"+[i]).firstChild.nodeValue = myTopics[number][i];
    }

    // show mean value
    document.getElementById("legend_heading4").firstChild.nodeValue = myTopics[number][15];

	// coloring the districts
	for (var i = 1; i <24; i++) {
		if (myDistricts[i][number] <= myTopics[number][1]) {
			document.getElementById(myDistricts[i][0]).setAttribute('fill',myTopics[number][5]);
		} else if (myDistricts[i][number] <= myTopics[number][2]) {
			document.getElementById(myDistricts[i][0]).setAttribute('fill',myTopics[number][6]);
		} else if (myDistricts[i][number] <= myTopics[number][3]) {
			document.getElementById(myDistricts[i][0]).setAttribute('fill',myTopics[number][7]);
		} else if (myDistricts[i][number] <= myTopics[number][4]) {
			document.getElementById(myDistricts[i][0]).setAttribute('fill',myTopics[number][8]);
		}
	}

}
